import React from "react";

import Layout from "../components/Layout";
import { UserContextProvider } from "../context/UserContext";
import HomePage from "../components/Home";

const Home = () => {
  return (
    <UserContextProvider>
      <Layout>
        <HomePage />
      </Layout>
    </UserContextProvider>
  );
};

export default Home;
